import '../home.css';

import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth0 } from '@auth0/auth0-react';

function Home() {
  const { isAuthenticated } = useAuth0();
  const [videoId, setVideoId] = useState('YQDDm9HLkV4');  // setting default video id

  useEffect(() => {
    fetch("https://youtube.googleapis.com/youtube/v3/search?part=snippet&channelId=UC7JBG8BXxqTgu6jpeJikImQ&q=nrOIhOsbSDk&key=AIzaSyBvB8S03KRxNVscvlNMLMlMrpM7THvVpyc")
    .then((result) => {
        return result.json();
    })
    .then((data) => {
        if (data.items.length > 0) {
          setVideoId(data.items[0].id.videoId); 
        }
    })
    .catch((error) => {
        console.log(error);
    });
  }, []);

  return (
    <div className={'container'}>
      <h1 className={'text-center bg-orange text-white'}>Welcome to Puppy Adoption Center!</h1>
      <div className={'row flex jc-c'}>
        <div className={'paper col-6 col-s-10 row'}>
          <div className={'col-6 col-s-12'}>
            <div style={{width: '100%'}}>
              <div id="embed-google-map" style={{height: "80%", width: "80%" , maxWidth: "100%"}}>
              <iframe title="api" 
  src={`https://www.youtube.com/embed/${videoId}?loop=1&modestbranding=1`}
  width="100%"
  height="400"
  allowFullScreen
>
</iframe>
              </div>
            </div>
          </div>
          <div className={'col-6 col-s-12'}>
            <h1>Your one-stop solution for adopting puppies.</h1>
            {!isAuthenticated ? (
              <div>
                <Link to="/login">
                  <button className={'button button-blue'}>
                    Login
                  </button>
                </Link> 
                <strong>
                  <i>
                    to start the adoption process.
                  </i>
                </strong>
              </div>
            ) : (
              <div>
                <Link to="/dashboard">Go to MyProfile</Link>
              </div>
            )}
            <div>
              <Link to="/puppies">See Available Puppies</Link>
            </div>

            <p>
              Name: xxx
            </p>
            <p>
              Phone: +86 15655555
            </p>
            <p>
              Address: The white house
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
